import React from "react";
import { Typography, Box, Button, Avatar, Input } from "@material-ui/core";

import { makeStyles } from "@material-ui/core/styles";

import TextField from "@material-ui/core/TextField";
import * as Yup from "yup";
import { Formik } from "formik";

const index = () => {
  return (
    <Box
      style={{
        backgroundColor: "#E9ECEF",
        height: "100vh",
        display: 'flex'
      }}
    >
      <Box>
        <Typography> First Name</Typography>
        <Input
          style={{ backgroundColor: "#ffffff", width: "400px" }}
          type="email"
          placeholder="Enter your vfirst name "
        />
      </Box>

      <Box>
        <Typography>Last Name</Typography>
        <Input
          style={{ backgroundColor: "#ffffff", width: "400px" }}
          type="email"
          placeholder="Enter your last name "
        />
      </Box>

      <style jsx global>{`
        body {
          margin: 0px;
        }
      `}</style>
    </Box>

    //     {/* <Typography style={{marginLeft:"350px",marginBottom:"40px"}}>Name:</Typography>
    //   <Input
    //     style={{ width: "500px", marginTop:"40px",padding:"8px",marginLeft: "350px", backgroundColor: "#ffffff" }}
    //     type="password"
    //     placeholder="Enter yor name  "
    //   />
    // </Box> */}
  );
};
export default index;
